import { extendObservable } from 'mobx';

class UserStore {
    constructor() {
        extendObservable(this, {
            // loading: true,
            // isLoggedIn: false,
            email: '',
            loading: false,
            isLoggedIn: true,
            // email: ''
        })
    }
}

export default new UserStore;
